    enterpriseUuid: {
      type: DataTypes.UUID,
      allowNull: false,
      validate: {
        notEmpty: { msg: "required field" },
        notNull: { msg: "not null field" }
      }
    },
    createdAt: {
      type: DataTypes.DATE,
      allowNull: false,
    },
    updatedAt: {
      type: DataTypes.DATE,
      allowNull: false,
    },
    deleteAt: {
      type: DataTypes.DATE
    }
  }, {
    sequelize,
    modelName: "User",
    tableName: "users",
    timestamps: true,
    hooks: {
      beforeCreate: (user) => {
        const salt = genSaltSync();
        user.password = hashSync(user.password, salt);
      },
    }
  });
  return User;
};

